import React from "react";
import TopNavBar from "../TopNavigationBar";
import ProductCard from "../productCards/ProductCard";
import { MDBContainer, MDBRow, MDBCol } from "mdbreact";

const Store = props => {
  return (
    <div>
      <TopNavBar />
      <MDBContainer>
        <MDBRow>
          <MDBCol size="12">
            <div className="card-columns">
              {/* <MDBCol size="4"> */}
              <ProductCard />
              {/* </MDBCol>
          <MDBCol size="4"> */}
              <ProductCard />
              {/* </MDBCol>
          <MDBCol size="4"> */}
              <ProductCard />
              {/* </MDBCol> */}
            </div>
          </MDBCol>
        </MDBRow>
        <MDBRow>
          <MDBCol>
            <ProductCard />
          </MDBCol>
          <MDBCol>
            <ProductCard />
          </MDBCol>
          {/* <MDBCol>
            <ProductCard />
          </MDBCol> */}
        </MDBRow>
      </MDBContainer>
      <div>stuff</div>
    </div>
  );
};
export default Store;
